import React from "react";
import "../css/style.css";
import "../css/bootstrap.min.css";

class Login extends React.Component {
  render() {
    return (
      <div class="login-box">
        <label for="username" />
        <input type="text" name="username" id="username" />
        <label for="password" />
        <input type="text" name="password" id="password" />
      </div>
    );
  }
}
